const RecipeList = ({ title }) => {
  console.log("image:", title.image);
  return (
    <div className="List">
      <table className="Table mdc-card">
        <tr>
          <td>Name: {title.title}</td>
        </tr>
        <tr>
          <td>Ingredient: {title.ingredient}</td>
        </tr>
        <tr>
          <td> {title.time}</td>
        </tr>
        <tr>
          <td>{title.image}</td>
        </tr>
      </table>
    </div>
  );
};

export default RecipeList;
